import React from "react";
import "./style.css";

const Body = (x) => {
  return (
    <div className="body">
       <div className="div">
        <div className="card">
              <img src={x.src} alt={x.alt} />


              <div className="card-body">
          <h1>{x.dealName}</h1>
          <p>{x.des}</p>
          <h4>see terms</h4>
            <button>Order now</button>
              </div>
         </div> 
        </div>
    </div>
  )
}

export default Body
